import React, { useEffect } from 'react'

function Users() {
    const UserRecord = [
        { name: "Muhammad Ali", email: "ali@gmail.com" },
        { name: "Tayyab Raza", email: "tabi@gmail.com" },
        { name: "Shoaib Imran", email: "shoaib@gmail.com" }
    ]
   

    // useEffect(() => {
    //     UserRecord.map((a) => {
    //         console.log(a.name)
    //     })
    // }, []);
    return (
        <div class="main-content  mt-4">

            <div class="container-fluid">
                <h2 class="mb-2 text-white">Users</h2>
                <div class="header-body mt-1 ">
                    <div class="row">
                        {UserRecord ?
                            (
                              <>
                                    <ul>
                                        {
                                            UserRecord.map(function (a) {
                                                console.log('test',a.name);
                                                <li key={a.email}>Test{a.name}</li>
                                                
                                            })
                                        }
                                    </ul>
                              </>) : (
                                <>
                                    <div class="col-xl-12 col-lg-12 my-2">
                                        <div class="card card-stats mb-4 mb-xl-0">
                                            <div class="card-body">
                                                <div class="row">
                                                    <div class="col">
                                                        <h5 class="card-title text-uppercase text-muted mb-0"></h5>
                                                        <span class="h2 font-weight-bold mb-0">No User Found</span>
                                                    </div>
                                                    <div class="col-auto">
                                                        <div class="icon icon-shape bg-danger text-white rounded-circle shadow p-2">
                                                            <i class="fas fa-users fa-2x "></i>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </>
                            )
                        }



                    </div>
                </div>
            </div>


        </div>
    )
}

export default Users
